import React, { useState } from "react";
import { AwesomeButton } from "react-awesome-button";
import 'react-awesome-button/dist/themes/theme-c137.css';
import InfoIcon from "@material-ui/icons/Info";
import SchoolIcon from "@material-ui/icons/School";
import WorkIcon from "@material-ui/icons/Work";
import ProjectsIcon from "@material-ui/icons/GitHub";
import SkillsIcon from "@material-ui/icons/LocalActivity";


export default function AddField(props) {

    const [field, setField,] = useState({
      title: "",
      input1:"",
      input2:"",
      input3:"",
      desc1:"",
    });

    function submitField(title) {

      setField({
        title: title,
        input1:"dsadsa",
        input2:"2222",
        input3:"333",
        desc1:"444",
      });
      props.onAdd(field);
    }


    var buttons = [{title:'Bio' ,icon:<InfoIcon/>},
                   {title:'Education',icon:<SchoolIcon/>},
                   {title:'Work History',icon:<WorkIcon/>},
                   {title:'Projects',icon:<ProjectsIcon/>},
                   {title:'Bio5',icon:<SkillsIcon/>}]
    return (
      <div>
        {buttons.map((item) => (
            <button
            onClick={() => submitField(item.title)}
            style={{margin:'5px', }}
            type="primary">
            {item.icon}
            </button>
        ))}
     </div>
    )
};
